import React, { useState, useEffect } from "react";
import axios from "axios";
const Rockets = () => {
  const [data, setData] = useState([]);
  const fetchData = () => {
    axios.get("https://api.spacexdata.com/v4/rockets").then((response) => {
      console.log(response.data);
    });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return <div></div>;
};

export default Rockets;
